import React from 'react';
import Navbar from '../../Navbar';
import './DigitalNotes.css';

const DigitalNotes = () => {
  var allCourses = [
    "HTML",
    "CSS",
    "JAVASCRIPT",
    "BOOTSTRAP",
    "MONGODB",
    "JQUERY",
    "REACT",
    "EXPRESS JS",
    "NODE JS",
    "ANGULAR",
    "NEXT JS",
    "WEB3 JS",
  ];

  return (
    <div>
      <Navbar />
      <br />
      <div className="MainDigitalNotesDiv">
        {allCourses.map((item) => (
          <div key={item}>
            <p>{item}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default DigitalNotes;
